import "../Dashboard.css";
import Button from "@mui/material/Button";
import { STUDENT } from "../Constants/ProfileForm";
import UserProfile from "../images/user_profile.png";

const Profile = () => {
  return (
    <div className="payments_form">
      <div><div className="heading-image">
      <img className="heading-image1" src={UserProfile} alt="firespot" /></div>
      <div className="heading-main1">
        <div className="heading-main2">
          <div className="heading">
            <span>Get the All Payments Ready in a Second</span>
          </div>
          <div className="description">
            <span>
              The University of Moratuwa is the country's leading technological
              higer education institution, succeeding locally and
              internationally. This gateway is for quick and secure university
              related payments.
            </span>
          </div>
        </div>
      </div>
      <div></div>
        <div>
          <hr />
        </div>
      </div>
      <div className="payment_header">Student Information</div>

      {STUDENT.map((field) => {
        if (field.show) {
          if (field.type === "select") {
            return (
              <div className="form-row" key={field.id}>
                <div className="form-label">{field.label}</div>
                <select className={field.className} disabled={field.disabled}>
                  {field.options.map((option) => {
                    return (
                      <option key={option.id} value={option.id}>
                        {option.label}
                      </option>
                    );
                  })}
                </select>
              </div>
            );
          } else {
            return (
              <div className="form-row" key={field.id}>
                <div className="form-label">{field.label}</div>
                <input
                  placeholder={field.label}
                  className={field.className}
                  type={field.type}
                  disabled={field.disabled}
                />
              </div>
            );
          }
        } else {
          return null;
        }
      })}

      <div className="next-button-main">
        <Button className="next-button">Save</Button>
      </div>
    </div>
  );
};

export default Profile;
